import React, { useState, useEffect } from 'react';
import axios from 'axios';

const [players, setPlayers] = useState([]);

  useEffect(() => {
    fetchPlayers();
  }, []);

  const fetchPlayers = async () => {
    try {
      const response = await axios.get("http://localhost:3000/api/v1/player");
      setPlayers(response.data);
      console.log(players);
    } catch (error) {
      console.error(error);
    }
  };
export default Home;
